import React, { useState, useEffect } from "react";
import axios from "axios";

const RealTimeApi = (props) => {
  const [state, setState] = useState({});
  useEffect(() => {
    axios
      .get("/api/real_time_api")
      .then((res) => res.json())
      .then(
        (result) => {
          setState({
            isLoaded: true,
            busdata: result,
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error,
          });
        }
      );
  }, []);
  console.log(state);

  return (
    <div>
      <p>Information from rtpi:</p>
    </div>
  );
};

export default RealTimeApi;
